	return (
		<Main>
			<Title>Charles Cantin - Photographe</Title>
		</Main>
	)
}

const Main = styled.main`
	display: flex;
	justify-content: center;
	align-items: center;
	height: calc(100vh - 80px);
	background-image: url(${Background})
	background
`

const Title = styled.h1`
	color: #d288e3;
	font-size: 50px;
`

export default Home
